import React from 'react';
import { useState ,useEffect} from 'react'; 
import {Container ,Card,Row, Col, Button} from 'react-bootstrap';
import admin from '../../admin.png'  
 
const Dashboard = () => {
   
   const[allcourses,setallcourses] = useState([])
   const[dummyregisters,setdummyregisters] = useState([])
   const[dummycourseregisters,setdummycourseregisters] = useState([])
 
   




   
   
   var [s,sets]=React.useState(0)
   function handleallcourse(){
       sets(0)
   }
    function handleaddcourse(){
       
        sets(1)
        
        
    }
    function handleregisterapprove(){
        
        sets(2)
        
        
    }
    function handlecourseapprove(){
        
        sets(3)
        
    }
    function handlefeeapprove(){
        
        sets(4)
        
    }
    
 
    return (
    <div className="col main pt-5 mt-3">
        <div className="col-md-3 col-lg-2 sidebar-offcanvas pl-0 side" id="sidebar" role="navigation" style={{backgroundColor:"#e9ecef"}}>
            <ul className="nav flex-column sticky-top pl-0 pt-5 p-3 mt-3 ">
                <center>
                <li className="nav-item mb-2 mt-3"><a className="nav-link text-secondary" href="#"><h5><b>Driver</b></h5></a></li>
                <li><img src={admin} className="imagestyle"/></li>
                
                <li className="nav-item mb-2 mt-3"><a className="nav-link text-secondary" href="#"><h5><b></b></h5></a></li>
                <li className="nav-item mb-2 "><span >Logout</span></li>
                </center>
                
            </ul>
       </div>
         
        <div className="row mb-3">
        
            
            <div className="col-xl-3 col-sm-6 py-2" onClick={handleregisterapprove}>
                <div className="card text-white bg-danger h-100">
                    <div className="card-body bg-danger">
                        
                        <h6 className="text-uppercase" >ALL CATEGORIES</h6>
                    </div>
                </div>
            </div>
            
            
            
            
            
        </div>

        
 
    </div>
    )
}
 
export default Dashboard
